    min-width: 1.4em
    height: 1em
    padding: .325em .3em
    &--indet
      .q-toggle__thumb
        left: .45em
    &--truthy
      color: $primary
      color: var(--q-color-primary)
      .q-toggle__track
        opacity: .54
      .q-toggle__thumb
        left: .65em
        &:after
          background-color: currentColor
        .q-icon
          color: #fff
          opacity: 1
  &.disabled
    opacity: .75 !important
  &--dark
    .q-toggle__inner
      color: #fff
      &--truthy
