    .q-toggle__thumb:before
      opacity: .32 !important
  &--dense
    .q-toggle__inner
      width: .8em
      min-width: .8em
      height: .5em
      padding: .07625em 0
    .q-toggle__thumb
      top: 0
      left: 0
    .q-toggle__inner--indet
      .q-toggle__thumb
        left: .15em
    .q-toggle__inner--truthy
      .q-toggle__thumb
        left: .3em
    .q-toggle__label
      padding-left: .5em
    &.reverse .q-toggle__label
      padding-left: 0
      padding-right: .5em
body.desktop
